import React from 'react';
import './NavBar.module.css'

const NavBar = () => {
    return (
        <nav>
            <img src='logo'/>
                <div className={'navbar-text'}>
                NAVBAR WORKING!
                </div>
        </nav>
    );
};

export default NavBar;
